import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { tests, checkStatus } from './Test'; // Используйте фигурные скобки для импорта именованных экспортов

const Section = styled.section`
    display: flex;
    justify-content: center;
    align-items: flex-start;
    flex-direction: column;
    padding-left: 8%;
    gap: 35px;
    padding-top: 2%;
`

const Attempt = styled.div`
    width: 294px;
    height: 64px;
    background-color: #D9D9D9;
    color: #000000;
    font-size: 16px;
    font-weight: 400;
    font-family: 'Montserrat';
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const Block = styled.div`
    width: 1294px;
    height: ${({ $height }) => $height ? '585px' : '196px'};
    background-color: #D5DEF6;
    border-radius: 10px;
`
const Ul = styled.ul`
    display: flex;
    justify-content: center;
    align-items: center;
`
const Attempts = () => {
    return (
        <>
            <Section>
                <Attempt>
                    Попытки 2
                </Attempt>
                <Block $height>
                    <Ul>
                        {tests.map((test, index) => (
                            <li key={index}>
                                Номер теста: {test.number}, Время выполнения: {test.time} секунд, Статус: {checkStatus(test.status)}
                            </li>
                        ))}
                    </Ul>
                    <div></div>
                </Block>
                <Block></Block>
                <div>
                    <div>
                        <Link></Link>
                        <Link></Link>
                    </div>
                </div>
            </Section>
        </>
    );
}

export default Attempts;
